import ProductList from "../halfshared/ProductList"

const PopProducts = () => {
    return (
        <section class="pop-products">
            <div class="section-header clearfix">
                <span class="section-title">Популярные товары:</span>
                <a class="btn" href="kiu">Все пополурные товары</a>
            </div>
            <ProductList></ProductList>
        </section>
    )
}

export default PopProducts
